export const patchNicknameReqest=async(reqestBody:PatchNicknameRequestDto,accessToken:string)=>{
    const result =await axios.patch(PATCH_NICKNAME_URL(),reqestBody,authorization(accessToken))
    .then(response=>{
        const responseBody:PatchNicknameResponseDto=response.data;
        return responseBody;
    })
    .catch(error=>{
        if(!error.response) return null;
        const responseBody:ResponseDto=error.response.data;
        return responseBody;
    });
    return result;
}


